import React from "react";
import Menu from "./Menu";
import { AppRouter } from "./AppRouter";
import "./Home.css";

const Home = () => {
  return (
    <div className="container">
      <div className="menu">
        <Menu />
      </div>
      <div className="content">
        <AppRouter />
      </div>
    </div>
  );
};

export default Home;
